export default function MainPage() {
  const navigate = useNavigate();

  const handleImageClick = (type) => {
    if (type === 'biryani') {
      navigate('/biryanis');
    } else if (type === 'pizzas') {
      navigate('/offers');
    } else if (type === 'Tiffins') {
      navigate('/tiffins');
    }
  };

  return (
    <Container>
      <Row>
        {foodImages.map((foodImage, index) => (
          <Col lg={4} key={index} style={{ marginBottom: '10rem' }}>
            <div className='image-container' onClick={() => handleImageClick(foodImage.type)}>
              <div className='circular-image'>
                {foodImage.image}
              </div>
              <h1>{foodImage.type}</h1>
            </div>
          </Col>
        ))}
      </Row>
      {/* Your video element here */}
    </Container>
  );
}
